import { Fragment } from 'react'
import { useHistory } from 'react-router-dom'

const Game = () => {
  const history = useHistory()

  const handleReset = (e) => {}
  const handleSubmit = (e) => {
    console.log(e);
    //dispatch({ type: 'ADD_YOUR_CHOICE' })
  }

  return (
    <Fragment>
      <h1>Game Juniper Green</h1>
      <button onClick={() => history.goBack()}>Back to the home page</button>
      <button onClick={() => history.push("/game/rules")}>Rules</button>
      <button onClick={(e) => handleReset()}>Reset</button>

      <p>Message :</p>
      <p>Computer :</p>
      <form>
        <input type="number" placeholder="enter your choice"/>
        <input type="submit" onSubmit={(e) => handleSubmit()}>Submit choice</input>
      </form>

      <p>Your choice :</p>
      <ul>
        <li></li>
      </ul>
      <p>Computer choice :</p>
      <ul>
        <li></li>
      </ul>
    </Fragment>
  );
}

export default Game;
